import React, { useState } from 'react';
import {Table, Button, Space, notification, message} from 'antd';
import { ExclamationCircleFilled } from '@ant-design/icons';
import { Conteudo } from './style';
import Painel from '../../../components/Painel/index';

const btn = [
    {nome: 'Perfil', url: '/Aluno/Perfil'},
    {nome: 'Relatório', url: '/Aluno/Relatorio'},
    {nome: 'Histórico', url: '/Aluno/Historico'},
    {nome: 'Sair', url: '/'},
]

export default function Relatorio(){
    const data = [
        {
          data: '25/07/2021',
          parecerOrientador: 'Adequado com ressalvaz',
          parecerCPP: 'Inadequado'
        }
    ]

    const columns = [
        {
          title: 'Data',
          dataIndex: 'data',
          key: 'data',
        },
        {
          title: 'Parecer Orientador',
          dataIndex: 'parecerOrientador',
          key: 'parecerOrientador',
        },
        {
          title: 'Parecer CPP',
          dataIndex: 'parecerCPP',
          key: 'parecerCPP',
        },
        {
          title: 'action',
          key: 'action',
          render: (text, record) => (
          <Space size="middle">
            <Button>Comentários</Button>
            <Button>Refazer</Button>
            </Space>
          ),
        },
      ];

    return(
        <Painel btns={btn}>
            <Conteudo>
                <Table 
                columns={columns} 
                dataSource={data} 
                pagination={{ pageSize: 8 }}
                >
                </Table>
            </Conteudo>
        </Painel>
    );
}
